export class ComplicationDeveloppementPubertaire
{
    PatientId:number;
    Puberte:string;
    RetardCroissance:boolean;
    TraitementHormonalAuCoursSuivi:boolean;
    SpecifierTraitementHormonal:string;

    constructor()
    {
        this.PatientId=0;
        this.Puberte='';
        this.RetardCroissance=false;
        this.TraitementHormonalAuCoursSuivi=false;
        this.SpecifierTraitementHormonal=''
    }
}
